import { createSlice } from '@reduxjs/toolkit';

const stringSlice = createSlice({
  name: 'string',
  initialState: '',
  reducers: {
    setString: (state, action) => {
      return action.payload;
    },
  },
});

export const { setString } = stringSlice.actions;
export default stringSlice.reducer;
